const Icon = ({ icon, tooltip, label }) => {
    const Icon = icons[icon]
    return (
        <>
            {Icon && <Icon />}
            {label && <h3 className="cwLabel">{label}</h3>}
            {tooltip && <span className="cw-tooltip">{tooltip}</span>}
        </>
    )
}

export default Icon